    data: |
      SELECT DISTINCT col1 * + col1 / col0 + col2 * - col1 FROM tab2 (FORMAT parquet) WHERE NOT col2 BETWEEN + col2 AND col1 + col0 * col0;
  - name: tab2

outputs:
  - name: q11194.out
    data: |
